import questions from "./data";
export default function App() {
  return (
    <div className="App">
      <FlashCards />
    </div>
  );
}

function FlashCards() {
  return (
    <div className="flashcards">
      <div>
        {questions.map((each) => {
          <p>{each.question}</p>;
        })}
      </div>
    </div>
  );
}
